import React, { useState } from "react";
import "./List.css";

function List({ data }) {
  const [isExpand, setExpand] = useState(false);

  return (
    <div className="list__container">
      <ul className="list__items">
        {data.map((d, index) => (
          <li className="list__item" key={index}>
            {d.title}
          </li>
        ))}
      </ul>
      {isExpand && (
        <ul>
          {data.map((d, index) => (
            <List data={d.child} />
          ))}
        </ul>
      )}
    </div>
  );
}

export default List;
